function doEdit(){document.getElementById("inputPassword").disabled="";document.getElementById("inputNickname").disabled="";document.getElementById("inputSexNone").disabled="";document.getElementById("inputSexMan").disabled="";document.getElementById("inputSexWoman").disabled="";document.getElementById("inputPhoneNumber").disabled="";document.getElementById("inputIdType").disabled="";document.getElementById("inputIdNumber").disabled="";document.getElementById("inputAddress").disabled="";document.getElementById("formFile").disabled="";document.getElementById("btn-submitEdit").hidden=""}function sexSelectInit(a){if(a==="无"){document.getElementById("inputSexNone").checked=true}else{if(a==="男"){document.getElementById("inputSexMan").checked=true}else{if(a==="女"){document.getElementById("inputSexWoman").checked=true}}}}function idTypeSelectInit(a){if(a==="居民身份证"){document.getElementById("residentIdentityCard").selected=true}else{if(a==="军官证"){document.getElementById("certificateOfOfficers").selected=true}else{if(a==="武警警官证"){document.getElementById("certificateOfArmedPoliceOfficer").selected=true}else{if(a==="士兵证"){document.getElementById("soldierCertificate").selected=true}else{if(a==="护照"){document.getElementById("passport").selected=true}}}}}}function alertSuccess(){}function alertWarning(){$("#warning").addClass("show");window.setTimeout(function(){$("#warning").removeClass("show")},2000)}function alertDanger(){$("#danger").addClass("show");window.setTimeout(function(){$("#danger").removeClass("show")},2000)};